import * as React from 'react';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

export default function BasicSelect() {
const [age, setAge] = React.useState('');

const handleChange = (event) => {
    setAge(event.target.value);
};

return (
    <Box sx={{ minWidth: '100%' }}>
    <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">Opportunity Browsing</InputLabel>
        <Select
        labelId="demo-simple-select-label"
        id="demo-simple-select"
        value={age}
        label="Opportunity Browsing"
        onChange={handleChange}
        >
        <MenuItem value='Applied'>Applied</MenuItem>
        <MenuItem value='Shortlisted'>Shortlisted</MenuItem>
        <MenuItem value='Opportunity Browsing'>Opportunity Browsing</MenuItem>
        <MenuItem value='Video Interview I'>Video Interview I</MenuItem>
        <MenuItem value='Video Interview II'>Video Interview II</MenuItem>
        <MenuItem value='Video Interview III'>Video Interview III</MenuItem>
        <MenuItem value='Technical Interview'>Technical Interview</MenuItem>
        <MenuItem value='Technical Interview'>Technical Interview</MenuItem>
        <MenuItem value='Technical Interview'>Technical Interview</MenuItem>
        </Select>
    </FormControl>
    </Box>
);
}
